import React from "react";
import styled from "styled-components";

const Nav = styled.div``;
const NavContainer = styled.div``;

const Navbar = () => {
    return (
      <Nav>
        <NavContainer>Hi</NavContainer>
      </Nav>
    );
};

export default Navbar;
